class NodoArbol {
    constructor(valor) {
        this.valor = valor;
        this.izquierdo = null;
        this.derecho = null;
        this.altura = 1; // Para árboles AVL
    }
}

class ArbolBinarioBusqueda {
    constructor() {
        this.raiz = null;
    }
    
    // Insertar elemento - O(log n) en promedio
    insertar(valor) {
        this.raiz = this._insertarRecursivo(this.raiz, valor);
    }
    
    _insertarRecursivo(nodo, valor) {
        if (nodo === null) {
            return new NodoArbol(valor);
        }
        
        if (valor < nodo.valor) {
            nodo.izquierdo = this._insertarRecursivo(nodo.izquierdo, valor);
        } else if (valor > nodo.valor) {
            nodo.derecho = this._insertarRecursivo(nodo.derecho, valor);
        }
        
        return nodo;
    }
    
    // Búsqueda - O(log n) en promedio
    buscar(valor) {
        return this._buscarRecursivo(this.raiz, valor);
    }
    
    _buscarRecursivo(nodo, valor) {
        if (nodo === null || nodo.valor === valor) {
            return nodo;
        }
        
        if (valor < nodo.valor) {
            return this._buscarRecursivo(nodo.izquierdo, valor);
        }
        
        return this._buscarRecursivo(nodo.derecho, valor);
    }
    
    // Recorrido inorden (elementos ordenados)
    inorden() {
        const resultado = [];
        this._inordenRecursivo(this.raiz, resultado);
        return resultado;
    }
    
    _inordenRecursivo(nodo, resultado) {
        if (nodo !== null) {
            this._inordenRecursivo(nodo.izquierdo, resultado);
            resultado.push(nodo.valor);
            this._inordenRecursivo(nodo.derecho, resultado);
        }
    }
    
    // Calcular altura del árbol
    altura(nodo = this.raiz) {
        if (nodo === null) return 0;
        return Math.max(this.altura(nodo.izquierdo), this.altura(nodo.derecho)) + 1;
    }
}

