class Grafo {
    constructor() {
        this.vertices = new Map();
    }
    
    // Agregar vértice
    agregarVertice(vertice) {
        if (!this.vertices.has(vertice)) {
            this.vertices.set(vertice, []);
        }
    }
    
    // Agregar arista
    agregarArista(origen, destino, peso = 1) {
        this.agregarVertice(origen);
        this.agregarVertice(destino);
        
        this.vertices.get(origen).push({ nodo: destino, peso });
        // Para grafo no dirigido, agregar también la arista inversa
        // this.vertices.get(destino).push({ nodo: origen, peso });
    }
    
    // Búsqueda en profundidad (DFS)
    dfs(inicio, visitados = new Set(), resultado = []) {
        visitados.add(inicio);
        resultado.push(inicio);
        
        const vecinos = this.vertices.get(inicio) || [];
        for (let vecino of vecinos) {
            if (!visitados.has(vecino.nodo)) {
                this.dfs(vecino.nodo, visitados, resultado);
            }
        }
        
        return resultado;
    }
    
    // Búsqueda en anchura (BFS)
    bfs(inicio) {
        const visitados = new Set();
        const cola = [inicio];
        const resultado = [];
        
        visitados.add(inicio);
        
        while (cola.length > 0) {
            const actual = cola.shift();
            resultado.push(actual);
            
            const vecinos = this.vertices.get(actual) || [];
            for (let vecino of vecinos) {
                if (!visitados.has(vecino.nodo)) {
                    visitados.add(vecino.nodo);
                    cola.push(vecino.nodo);
                }
            }
        }
        
        return resultado;
    }
    
    // Algoritmo de Dijkstra para camino más corto
    dijkstra(inicio) {
        const distancias = new Map();
        const visitados = new Set();
        const cola = [];
        
        // Inicializar distancias
        for (let vertice of this.vertices.keys()) {
            distancias.set(vertice, vertice === inicio ? 0 : Infinity);
        }
        
        cola.push({ nodo: inicio, distancia: 0 });
        
        while (cola.length > 0) {
            // Encontrar nodo con menor distancia
            cola.sort((a, b) => a.distancia - b.distancia);
            const { nodo: actual } = cola.shift();
            
            if (visitados.has(actual)) continue;
            visitados.add(actual);
            
            const vecinos = this.vertices.get(actual) || [];
            for (let vecino of vecinos) {
                const nuevaDistancia = distancias.get(actual) + vecino.peso;
                
                if (nuevaDistancia < distancias.get(vecino.nodo)) {
                    distancias.set(vecino.nodo, nuevaDistancia);
                    cola.push({ nodo: vecino.nodo, distancia: nuevaDistancia });
                }
            }
        }
        
        return distancias;
    }
}

